import React from 'react';
import classes from './SecondPost.module.css'
import {NavLink} from "react-router-dom";
import MessageSend from "./Message/MessageSend";
import DialigItem from "./Dialogitem/DialigItem";

const SecondPost = (props) => {

    let messagesElements = props.state.messagesData
        .map(message => <MessageSend message={props.state.messagesData.message} />);

    return (
        <div className={classes.dialogs}>

            <div className={classes.dialogsItem}>
                <DialigItem name={props.dialogsData[0].name} id={props.dialogsData[0].id}/>
                <DialigItem name={props.dialogsData[1].name} id={props.dialogsData[1].id}/>
                <DialigItem name={props.dialogsData[2].name} id={props.dialogsData[2].id}/>
            </div>
            {messagesElements}
            {/*<div className={classes.messages}>
                <MessageSend message={props.messagesData[0].message} />
                <MessageSend message={props.messagesData[1].message}/>
                <MessageSend message='ho'/>

            </div>*/}
            <div className={classes.dot}>
                <div>-</div>
                <div>-</div>
                <div>-</div>
            </div>
        </div>
    );
};

export default SecondPost;
